import React, { useState } from 'react';

const Checkbox = ({labelText, value}) => {
    const [data, setData] = useState({
        getValue: value,
    });
    
   console.log(data.getValue);

    return(
        <div className='form-check'>
            <input className='form-check-input' type={"radio"} name='flexRadio' value={data.value} onClick={() => setData(e.target.value)} />
            <label className='form-check-label' htmlFor='flexRadio1'>
                {labelText}
            </label>
        </div>
    )
}

export default Checkbox;
